import React from 'react';


function ToDoItem(props) {

    return ( 
        <div onClick={ () => {
            props.onChecked(props.id)
        } }>
            <li>{props.text}</li>
            <button>
                <span>Edit</span>
            </button>
        </div>
    )
}

export default ToDoItem;
